selector_to_html = {"a[href=\"#api\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">API<a class=\"headerlink\" href=\"#api\" title=\"Link to this heading\">#</a></h2><h3>var expanded = expand(str)<a class=\"headerlink\" href=\"#var-expanded-expand-str\" title=\"Link to this heading\">#</a></h3><p>Return an array of all possible and valid expansions of <code class=\"docutils literal notranslate\"><span class=\"pre\">str</span></code>. If none are\nfound, <code class=\"docutils literal notranslate\"><span class=\"pre\">[str]</span></code> is returned.</p><p>Valid expansions are:</p>", "a[href=\"#var-expanded-expand-str\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">var expanded = expand(str)<a class=\"headerlink\" href=\"#var-expanded-expand-str\" title=\"Link to this heading\">#</a></h3><p>Return an array of all possible and valid expansions of <code class=\"docutils literal notranslate\"><span class=\"pre\">str</span></code>. If none are\nfound, <code class=\"docutils literal notranslate\"><span class=\"pre\">[str]</span></code> is returned.</p><p>Valid expansions are:</p>", "a[href=\"#contributors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Contributors<a class=\"headerlink\" href=\"#contributors\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#sponsors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sponsors<a class=\"headerlink\" href=\"#sponsors\" title=\"Link to this heading\">#</a></h2><p>This module is proudly supported by my <a class=\"tippyAnchor reference external\" href=\"https://github.com/juliangruber/sponsors\">Sponsors</a>!</p><p>Do you want to support modules like this to improve their quality, stability and weigh in on new features? Then please consider donating to my <a class=\"tippyAnchor reference external\" href=\"https://www.patreon.com/juliangruber\">Patreon</a>. Not sure how much of my modules you\u2019re using? Try <a class=\"tippyAnchor reference external\" href=\"https://github.com/feross/thanks\">feross/thanks</a>!</p>", "a[href=\"#brace-expansion\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">brace-expansion<a class=\"headerlink\" href=\"#brace-expansion\" title=\"Link to this heading\">#</a></h1><p><a class=\"tippyAnchor reference external\" href=\"https://www.gnu.org/software/bash/manual/html_node/Brace-Expansion.html\">Brace expansion</a>,\nas known from sh/bash, in JavaScript.</p><p><a class=\"tippyAnchor reference external\" href=\"http://travis-ci.org/juliangruber/brace-expansion\"><img alt=\"build status\" loading=\"lazy\" src=\"https://secure.travis-ci.org/juliangruber/brace-expansion.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.org/package/brace-expansion\"><img alt=\"downloads\" loading=\"lazy\" src=\"https://img.shields.io/npm/dm/brace-expansion.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://greenkeeper.io/\"><img alt=\"Greenkeeper badge\" loading=\"lazy\" src=\"https://badges.greenkeeper.io/juliangruber/brace-expansion.svg\"/></a></p>", "a[href=\"#security-contact-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Security contact information<a class=\"headerlink\" href=\"#security-contact-information\" title=\"Link to this heading\">#</a></h2><p>To report a security vulnerability, please use the\n<a class=\"tippyAnchor reference external\" href=\"https://tidelift.com/security\">Tidelift security contact</a>.\nTidelift will coordinate the fix and disclosure.</p>", "a[href=\"#installation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installation<a class=\"headerlink\" href=\"#installation\" title=\"Link to this heading\">#</a></h2><p>With <a class=\"tippyAnchor reference external\" href=\"https://npmjs.org\">npm</a> do:</p>", "a[href=\"#example\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Example<a class=\"headerlink\" href=\"#example\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#license\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">License<a class=\"headerlink\" href=\"#license\" title=\"Link to this heading\">#</a></h2><p>(MIT)</p><p>Copyright \u00a9 2013 Julian Gruber &lt;julian@juliangruber.com&gt;</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
